import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { Button } from 'antd'
class App extends Component {
  render() {
    return (
      <div>
        <Button type="primary" size="small">
          Loading
        </Button>
      </div>
    );
  }
}

export default App;
